VIRGIN HOLIDAYS’ PRIVACY POLICY – LET US PUT YOUR MIND AT REST

INTRO
Here at Virgin Holidays Limited (“Virgin Holidays”, or “we”, “us”) we pride ourselves on our customer service. This includes how we handle your personal information. We try to be crystal clear about how we use your information, to give you choices about how we use it, and to ensure its security. 
